import React from 'react';
import { Link } from "react-router-dom";
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Box from '@material-ui/core/Box';

/* temp file list */
const files = [
    { id: 1, name: "file1.pdf", pages: 8, processing_date: "2020-11-12 16:06:59", uploader: "dev123@adapt.com" },
    { id: 2,  name: "file2.pdf", pages: 3, processing_date: "2020-11-13 18:07:04", uploader: "dev123@adapt.com" },
    { id: 3, name: "file3.pdf", pages: 2, processing_date: "2020-11-11 08:13:52", uploader: "dev123@adapt.com" },
    { id: 4, name: "file4.pdf", pages: 1, processing_date: "2020-12-12 13:22:34", uploader: "dev123@adapt.com" },
    { id: 5, name: "file5.pdf", pages: 3, processing_date: "2020-05-22 17:04:22", uploader: "dev123@adapt.com" },
];

function handleClick(e){
    console.log(e.target.name);
}

const fileList = files.map((file, id) => {
    return 
    <Link style={{ textDecoration: 'none', color: 'black' }} to='/detail'>
        <ListItem button onClick={handleClick}>
            <ListItemText primary={file.name}/>
        </ListItem>
    </Link>;
});

const useStyles = makeStyles((theme) => ({
    root: {
        width: '100%',
        maxWidth: 360,
        borderRadius: '4px',
        overflow: 'auto',
    },
}));


export default function FileList() {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Box bgcolor="primary.main" height={535}>
                <List component="nav">
                    {fileList}
                </List>
            </Box>
        </div>
    );
}



